import React from 'react';
import MyBtn from './MyBtn';

const TimerWrapper = () => {
    return (
        <div>
            <MyBtn time={5}>5 секунд</MyBtn>
            <MyBtn time={10}>10 секунд</MyBtn>
            <MyBtn time={15}>15 секунд</MyBtn>

        </div>
    );
};

export default TimerWrapper;
